import React from "react";
import "./style.css";

const imgArray = ["dog1.jpeg", "dog2.jpeg", "dog3.jpeg", "dog4.jpeg", "dog5.jpeg", "dog6.jpeg", "dog7.jpeg", "dog8.jpeg", "dog9.jpeg", "dog10.jpeg", "dog11.jpeg", "dog12.jpeg", "dog13.jpeg", "dog14.jpeg", "dog15.jpeg", "dog16.jpeg"]

function Images(props) {
  return (
    <div>
      <img src={ require('../img/' + imgArray[Math.floor(Math.random()*imgArray.length)]) } />
      <img src={ require('../img/dog3.jpeg') } />
      <img src={ require('../img/dog4.jpeg') } />
      <img src={ require('../img/dog5.jpeg') } />
    </div>
  );
}

export default Images;
